  active: false
},
{
  title:'Explore the World',
  image: 'https://images.unsplash.com/photo-1558979158-65a1eaa08691?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1350&q=80',
  active: false
},
{
  title:'Explore the World',
  image: 'https://images.unsplash.com/photo-1558979158-65a1eaa08691?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1350&q=80',
  active: false
},
];


function App() {
  return (


    <div>
      {images.map((data)=> 
      <SlidingCards
      data = {data}
    />
      )}

    </div>
  );
}

export default App;
